import React from 'react';
import { BrowserRouter as Router, Route} from 'react-router-dom';
import App from './App';

const Routes = () => (
    <Router>
            <Route exact path="/" component={App} />
            <Route exact path='/library:user' component={App} />
    </Router>
);

export default Routes;
